// src/data/sampleProducts.js

const sampleProducts = [
    {
      id: '1',
      title: 'Vintage Camera',
      description: 'A classic film camera for collectors and hobbyists.',
      price: 129.99,
      imageUrl: 'https://loremflickr.com/300/200/camera'
    },
    {
      id: '2',
      title: 'Bluetooth Headphones',
      description: 'Noise-cancelling over-ear headphones with long battery life.',
      price: 89.50,
      imageUrl: 'https://loremflickr.com/300/200/headphones'
    },
    {
      id: '3',
      title: 'Ceramic Coffee Mug',
      description: 'A sturdy ceramic mug to kickstart your mornings.',
      price: 14.25,
      imageUrl: 'https://loremflickr.com/300/200/coffee,mug'
    },
    {
      id: '4',
      title: 'Desk Succulent',
      description: 'A small potted succulent to brighten up your desk.',
      price: 12.00,
      imageUrl: 'https://loremflickr.com/300/200/succulent,plant'
    }
  ];
  
  export default sampleProducts;
